const VALID_HEX_CODE_FORMAT = new RegExp("^#([A-Fa-f0-9]{6}|[A-Fa-f0-9]{3})$");
const MAX_HUE_ANGLE = 360;
function isValidColorCode(colorCode) {
	return VALID_HEX_CODE_FORMAT.test(colorCode);
}
function isValidCSSHexColor(colorCode) {
	return isValidColorCode(colorCode) && CSS.supports("color", colorCode);
}
function getColorLuminance(c) {
	const { r, g, b } = hexToRgb(c);
	return (.299 * r + .587 * g + .114 * b) / 255;
}
function isMonochrome(c) {
	const { r, g, b } = hexToRgb(c);
	return r == g && g == b;
}
function isColorLight(c) {
	return getColorLuminance(c) > .5;
}
function normalizeHueAngle(hue) {
	return (hue % MAX_HUE_ANGLE + MAX_HUE_ANGLE) % MAX_HUE_ANGLE;
}
function hexToHSL(hex) {
	return rgbToHSL(hexToRgb(hex));
}
function hslToHex(color) {
	return rgbToHex(hslToRGB(color));
}
function hslToRGB(color) {
	let { h, s, l } = color;
	h = h % MAX_HUE_ANGLE;
	if (h < 0) h += MAX_HUE_ANGLE;
	s /= 100;
	l /= 100;
	function f(n) {
		let k = (n + h / 30) % 12;
		let a = s * Math.min(l, 1 - l);
		return l - a * Math.max(-1, Math.min(k - 3, 9 - k, 1));
	}
	return {
		r: Math.round(f(0) * 255),
		g: Math.round(f(8) * 255),
		b: Math.round(f(4) * 255)
	};
}
function rgbToHSL(color) {
	let { r, g, b } = color;
	r = r / 255;
	g = g / 255;
	b = b / 255;
	const cmin = Math.min(r, g, b);
	const cmax = Math.max(r, g, b);
	const delta = cmax - cmin;
	let h = 0, s = 0, l = 0;
	if (delta === 0) h = 0;
else if (cmax === r) h = (g - b) / delta % 6;
else if (cmax === g) h = (b - r) / delta + 2;
else h = (r - g) / delta + 4;
	h = Math.round(h * 60);
	if (h < 0) h += MAX_HUE_ANGLE;
	l = (cmax + cmin) / 2;
	s = delta === 0 ? 0 : delta / (1 - Math.abs(2 * l - 1));
	s = Number((s * 100).toFixed(1));
	l = Number((l * 100).toFixed(1));
	return {
		h: Math.round(h),
		s: Math.round(s),
		l: Math.round(l)
	};
}
function hexToRgb(colorCode) {
	assert(isValidColorCode(colorCode), "Invalid color code: " + colorCode);
	let hexWithoutHash = colorCode.slice(1);
	if (hexWithoutHash.length === 3) hexWithoutHash = expandHexTriplet(hexWithoutHash);
	const rgb = parseInt(hexWithoutHash, 16);
	const r = rgb >> 16 & 255;
	const g = rgb >> 8 & 255;
	const b = rgb >> 0 & 255;
	return {
		r,
		g,
		b
	};
}
function rgbToHex(color) {
	return "#" + (16777216 + (color.r << 16) + (color.g << 8) + color.b).toString(16).slice(1);
}
function hexToRGBAString(color, alpha) {
	const { r, g, b } = hexToRgb(color);
	return `rgba(${r}, ${g}, ${b}, ${alpha})`;
}
function expandHexTriplet(triplet) {
	assert(triplet.length === 3, "Provided invalid value for triplet: " + triplet);
	return Array.from(triplet).reduce((acc, cur) => `${acc}${cur}${cur}`, "");
}

